        return new Source("{% extends \"admin/layouts/admin.html.twig\" %}

{% block title %}{{ form.vars.value.id is defined ? 'Edit Office' : 'Add New Office' }}{% endblock %}

{% block body %}
    <h1 class=\"mb-4\">{{ form.vars.value.id is defined ? 'Office' : 'Add New Office' }}</h1>

    {{ form_start(form) }}
        <div class=\"mb-3\">
            {{ form_label(form.name) }}
            {{ form_widget(form.name, {'attr': {'class': 'form-control'}}) }}
            {{ form_errors(form.name) }}
        </div>

        <div class=\"mb-3\">
            {{ form_label(form.location) }}
            {{ form_widget(form.location, {'attr': {'class': 'form-control'}}) }}
            {{ form_errors(form.location) }}
        </div>

        <div class=\"mb-3\">
            {{ form_label(form.agents) }}
            {{ form_widget(form.agents, {'attr': {'class': 'form-control'}}) }}
            {{ form_errors(form.agents) }}
        </div>

        <div class=\"mb-3\">
            {{ form_label(form.phone) }}
            {{ form_widget(form.phone, {'attr': {'class': 'form-control'}}) }}
            {{ form_errors(form.phone) }}
        </div>

        <button class=\"btn btn-primary\">Save</button>
    {{ form_end(form) }}

    <a href=\"{{ path('office_list_admin') }}\" class=\"btn btn-secondary mt-3\">Back to list</a>
{% endblock %}
